import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';
//import { Link } from 'react-router-dom';
import { LinkContainer } from 'react-router-bootstrap';

export default function Menu(props){
    return(<Navbar bg="light" expand="lg">
    <Container>
      <LinkContainer to="/"><Navbar.Brand>Menu de Governança</Navbar.Brand></LinkContainer>
      <Navbar.Toggle aria-controls="basic-navbar-nav" />
      <Navbar.Collapse id="basic-navbar-nav">
        <Nav className="me-auto">
          <NavDropdown title="Cadastro" id="basic-nav-dropdown">
            <LinkContainer to="/cadastroCamareiro"><NavDropdown.Item>Camareiro</NavDropdown.Item></LinkContainer>
            <NavDropdown.Divider />
            <LinkContainer to="/cadastroAtividadeCamareiro"><NavDropdown.Item>Atividade dos Camareiros</NavDropdown.Item></LinkContainer>
          </NavDropdown>
        </Nav>
      </Navbar.Collapse>
    </Container>
  </Navbar>

    );
}
